import React, { Component } from 'react';
import DiyInfo from './Diyinfo';
import { Pagination, PaginationItem, PaginationLink } from 'reactstrap';

class DiyList extends Component{
    static defaultProps = {
        data: [],
    }

    render(){
        const { category } = this.props;
        const { data } = this.props;
        const list = data.map(
            info => (
                <DiyInfo
                    key={info.id}
                    info={info}
                />)
        );

        return(
            <div>
                <h2>List</h2>
                {
                    (()=> {
                        if (category === 1) return (<div> motor {list} </div>);
                        if (category === 2) return (<div> wings {list} </div>);
                        if (category === 3) return (<div> frame {list} </div>);
                        if (category === 4) return (<div> control board{list} </div>);
                        if (category === 5) return (<div> esc {list} </div>);
                        if (category === 6) return (<div> battery {list} </div>);
                        if (category === 7) return (<div> antenna {list} </div>);
                    })()
                }
            </div>
        );
    }
}

export default DiyList;
